import React from 'react';
import ContactUsComp from '../components/contact-us/ContactUsComp';
import Layout from '../components/common/Layout';

const ContactUs = () => (
  <>
    <Layout>
      <ContactUsComp />
    </Layout>
  </>
);

export default ContactUs;
